webpackJsonp([0x990e859d7e12],{613:function(t,a){t.exports={data:{markdownRemark:{html:'<p>As a team member of a program, you can set up two-factor authentication using any device capable of generating Time-based One-Time Password (TOTP) authentication codes (RFC-6238) to log in to HackerOne. You can use Google Authenticator or Duo Mobile or any other compatible application to generate the codes.</p>\n<p>To configure two-factor authentication:</p>\n<ol>\n<li>Log in to your HackerOne profile.</li>\n<li>Go to <strong>Settings > Authentication</strong>.</li>\n<li>Click <strong>Turn on</strong>. <em>Note: You can only enable two-factor authentication if you\'re in a launched program.</em></li>\n<li>Follow the steps in the <strong>Enable Two-Factor Authentication</strong> window.  </li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/two-factor-authentication-a9ec904d5c0df9d909ff16d3ead7b2e4-9a3e8.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 179.1741472172352%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="two-factor-authentication"\n        title=""\n        src="/static/two-factor-authentication-a9ec904d5c0df9d909ff16d3ead7b2e4-e7ffa.png"\n        srcset="/static/two-factor-authentication-a9ec904d5c0df9d909ff16d3ead7b2e4-49813.png 125w,\n/static/two-factor-authentication-a9ec904d5c0df9d909ff16d3ead7b2e4-dc8a5.png 250w,\n/static/two-factor-authentication-a9ec904d5c0df9d909ff16d3ead7b2e4-e7ffa.png 500w,\n/static/two-factor-authentication-a9ec904d5c0df9d909ff16d3ead7b2e4-9a3e8.png 557w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="5">\n<li>Click <strong>Verify and save</strong>.</li>\n</ol>\n<p>Once your two-factor authentication has been verified, when you log in to HackerOne, you’ll be prompted to enter a 6-digit verification code from your authentication application. You must enter the verification code in order to successfully log in to HackerOne.</p>\n<p><em>Note: Two-factor Authentication is on a per-user basis. You can’t have single-source sign-on (SSO) and 2FA simultaneously.</em></p>',frontmatter:{path:"/programs/two-factor-authentication.html",id:"programs/two-factor-authentication",title:"Two Factor Authentication",description:null}}},pathContext:{}}}});
